const Permutations = `
function combiSum(arr, num) {
  const result = [];
  const sum = new Set();

  for (let i = 0; i < arr.length; i++) {
    const ele = num - arr[i];
    if (sum.has(ele)) {
      result.push([arr[i], ele]);
    }
    sum.add(arr[i]);
  }

  console.log(result);
}

combiSum([2, 1, 4, 3, 5], 7);
`.trim();

const amount = `
function getCount() {
  var str = 'appleo';
  var hash = {};

  for (var i = 0; i < str.length; i++) {
    var char = str[i].toLowerCase();
    if ('aeiou'.includes(char)) {
      if (hash[char]) {
        hash[char]++;
      } else {
        hash[char] = 1;
      }
    }
  }

  var obj = new Map(Object.entries(hash));
  console.log(obj);
}

getCount();
`.trim();

const armstrong = `function fun(num) {
  const newnum = num.toString().split('');
  const hash = newnum.reduce((sum, digit) => {
    const cube = Math.pow(parseInt(digit), newnum.length);
    return sum + cube;
  }, 0);

  if (hash === num) {
    return { type: 'Armstrong', hash: hash };
  } else {
    return { type: 'Not Armstrong', hash: hash };
  }
}

const hash = fun(153);
console.log(hash); `.trim(); 

